import React from "react";
import Label from "./Label";
import Input from "./Input";

const Form = ({ look }) => {
  return (
    <form className={look}>
      <div>
        <Label type="Email" />
        <div class="mt-2">
          <Input type="Email" />
        </div>
      </div>
      <div>
        <Label type="Password" />
        <div class="mt-2">
          <Input type="Password" />
        </div>
      </div>
    </form>
  );
};

export default Form;
